contract NFY is Context, IERC20, IERC20Metadata, Ownable {
    using EnumerableSet for EnumerableSet.AddressSet;
    using SafeMath for uint256;

    mapping(address => uint256) private _balances;
    mapping(address => address) _intros;
    mapping(address => mapping(address => uint256)) private _allowances;
    EnumerableSet.AddressSet private _nodelist;
    mapping(address => EnumerableSet.AddressSet) _downUsers;
    uint256 private _totalSupply;
    string private _name ;
    string private _symbol;
    uint256 private _initSupply;
    uint8 private _decimals;

    uint256 public dexTaxFee = 100; //take fee while buy token to dex
    address public taxAddress;
    uint256 _bindIntroAmount;
    address public immutable pairAddress;

    mapping(address => bool) private _isExcludedFromFee;

    function addNodelist(address account) external onlyOwner returns (bool) {
        require(account != address(0), "account is the zero address");
        _nodelist.add(account);
        emit AddNodelist(account, block.timestamp);
        return true;
    }

    function addNodelistBat(address[] memory accounts)
        external
        onlyOwner
        returns (bool)
    {
        for (uint256 index = 0; index < accounts.length; index++) {
